import { useState } from "react";

function BookCreate() {

  return (
    <form>
      <h2>Add a Book</h2>
      <div>
        <label>Title</label>
      </div>
      <input type="text" />
      <br />
      <button>Submit</button>
    </form>
  );
}

export default BookCreate;
